import Pikachu from '../../img/pikachu.png';
import Charmander from '../../img/charmander.png';
import {ContainerCard, ContainerPokemon , ContainerButton} from './style';
import Button from '@mui/material/Button';
import DetailsIcon from '@mui/icons';
// import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';

export const CardPokemonHome = () => {

    return (
        <div>
            <ContainerCard>
                <ContainerPokemon>
                    <img src={Pikachu} alt='Pikachu'/>
                    <h3>Pikachu</h3>
                </ContainerPokemon>
                    <ContainerButton>
                        <Button variant="outlined" 
                            size="small"
                            startIcon={<DetailsIcon />}
                        >Adicionar a Pokedex</Button>
                        <Button variant="outlined" 
                            size="small"
                            // startIcon={<AddCircleOutlineIcon />}
                        >Detalhes</Button>
                    </ContainerButton>
            </ContainerCard>
        {/* <ContainerCardPokemonHome>
            <img src={Charmander} alt='Charmander'/>
